import React, { Fragment } from 'react';
import '../../App.css'
import { Link, Redirect } from 'react-router-dom';
import { logout } from '../../action/auth';
import { connect } from 'react-redux';
import setAlert from '../../action/aleart';
import PropTypes from 'prop-types'

const SearchBar = () => {
    const [formData, setFormData] = useState({

    });

    const { name, email, password, password2 } = formData;
    const onChange = e => setFormData({ ...formData, [e.target.name]: e.target.value });

    const onSubmit = async e => {
        e.preventDefault();
        if (password !== password2) {
            alert('Passwords do not match', 'danger')
            setAlert('Passwords do not match', 'danger');
        } else {
            register({ name, email, password });
        }
    };

    return (
        <Fragment>
            <div className="container">
                <div className="row pt-1 pb-1">
                    <div className="col-lg-12">
                        <h1 className="text-center">Search bar</h1>
                    </div>
                </div>
            </div>
            <section>
                <div id="carouselExampleFade" className="carousel slide carousel-fade" data-ride="carousel">
                    <a className="carousel-control-prev" href="#carouselExampleFade" role="button" data-slide="prev">
                        <span className="carousel-control-prev-icon" aria-hidden="true"></span>
                        <span className="sr-only">Previous</span>
                    </a>
                    <a class="carousel-control-next" href="#carouselExampleFade" role="button" data-slide="next">
                        <span className="carousel-control-next-icon" aria-hidden="true"></span>
                        <span className="sr-only">Next</span>
                    </a>
                </div>
            </section>
            <section className="search-sec">
                <div className="container">
                    <form action="#" method="post" novalidate="novalidate">
                        <div className="row">
                            <div className="col-lg-12">
                                <div className="row">
                                    <div className="col-lg-3 col-md-3 col-sm-12 p-0">
                                        <input type="text" className="form-control search-slt" placeholder="Enter Pickup City" />
                                    </div>
                                    <div className="col-lg-3 col-md-3 col-sm-12 p-0">
                                        <input type="text" className="form-control search-slt" placeholder="Enter Drop City" />
                                    </div>
                                    <input type="Date" name="date" className="form-control date-style" placeholder="to" />
                                    <div className="col-lg-3 col-md-3 col-sm-12 p-0">
                                        <button type="button" className="btn btn-danger wrn-btn">Search</button>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </form>
                </div>
            </section>
        </Fragment>
    );
}

export default connect(null, {})(SearchBar);
